import React from "react";

const UserItem = ({ user, onDelete, onEdit }) => {

  console.log("UserItem props:", { onDelete, onEdit });

  return (
    <div>
      <p><strong>Name:</strong> {user.name}</p>
      <p><strong>Email:</strong> {user.email}</p>
      <p><strong>Age:</strong> {user.age}</p>
      <p><strong>Address:</strong> {user.address}</p>
      <button
        onClick={() => {
          console.log("Edit button clicked for user:", user);
          onEdit && onEdit(user); // onEdit이 함수일 때만 호출
        }}
      >
        Edit
      </button>
      <button
        onClick={() => {
          console.log("Delete button clicked for user ID:", user.id);
          onDelete && onDelete(user.id); // onDelete가 함수일 때만 호출
        }}
      >
        Delete
      </button>
    </div>
  );
};

export default UserItem;
